import { Container, Grid, Typography } from "@material-ui/core";
import React from "react";

function AppHome() {
  return (
    <div>
      <Container maxWidth="md">
        <Grid container>
          <Grid container item>
            <Typography>Ứng dụng tiện lợi dành cho</Typography>
            <Typography>người yêu điện ảnh</Typography>
            <br />
            <Typography>
              Không chỉ đặt vé, bạn còn có thể bình luận phim, chấm điểm rạp và
              đổi quà hấp dẫn.
            </Typography>
            <br />
            <Typography>TIX có hai phiên bản IOS & Android</Typography>
          </Grid>
        </Grid>
      </Container>
    </div>
  );
}

export default AppHome;
